fragment WarehouseFragment on Warehouse {
  id
  name
  __typename
}

fragment WarehouseWithShippingFragment on Warehouse {
  ...WarehouseFragment
  shippingZones(first: 100) {
    edges {
      node {
        id
        name
        __typename
      }
      __typename
    }
    __typename
  }
  __typename
}

fragment PageInfoFragment on PageInfo {
  endCursor
  hasNextPage
  hasPreviousPage
  startCursor
  __typename
}

query WarehouseList($first: Int, $after: String, $last: Int, $before: String, $filter: WarehouseFilterInput, $sort: WarehouseSortingInput) {
  warehouses(before: $before, after: $after, first: $first, last: $last, filter: $filter, sortBy: $sort) {
    edges {
      node {
        ...WarehouseWithShippingFragment
        __typename
      }
      __typename
    }
    pageInfo {
      ...PageInfoFragment
      __typename
    }
    __typename
  }
}
